//	side-panel.js

SidePanel = function(){

	var container = new UI.Panel();
	container.setId("right-side");
	container.setClass("side-panel");

//	css.

	container.setTop("0");
	container.setRight("0");
	container.setBottom("0");
	container.setWidth("380px");
	container.setColor("#eee");
	container.setPosition("absolute");
	container.setBackgroundColor("rgba(0,0,0,0.4)");
	container.dom.style["-webkit-transform"] = "translateX( 340px )";
	container.dom.style["-webkit-transition"] = "-webkit-transform 500ms ease-out";

	return container;

};

debugMode && console.log( "player:", player );

var rightSide = new SidePanel();
player.dom.appendChild( rightSide.dom );

rightSide.dom.addEventListener("mouseenter", function(){
	this.classList.toggle( "pinned", true );
	this.style["-webkit-transform"] = "translateX( 0 )";
});

rightSide.dom.addEventListener("mouseleave", function(){
	this.classList.toggle( "pinned", false );
	this.style["-webkit-transform"] = "translateX( 340px )";
});

function toggleSidePanel(button){
	button.pinned = !button.pinned;
	button.classList.toggle( "pinned", button.pinned );
	button.parentElement.classList.toggle( "pinned", button.pinned );
};

function stop(){

	rightSide.dom.remove();

}

